window.bookSummaryJSON = "<p>Top 40 Amazon Best Seller </p> <p><b>From </b><b><i>Wall Street Journal</i></b><b> best-selling author Giana Darling comes an age gap, forbidden romance between an ex-con MC President and the daughter of the town’s mayor....</b></p> <p>I was a good girl. <br> I ate my vegetables, volunteered at the local autism centre, and sat in the front pew of church every Sunday. <br> Then, I got cancer. <br> What the hell kind of reward was that for a boring life well lived? <br> I was a 17-year-old paradigm of virtue, and I was tired of it. <br> So, when I finally ran into the man I'd been writing to since he saved my life as a little girl and he offered to show me the dark side of life before I left it for good, I said yes. <br> Only, I didn't know that Zeus Garro was the President of The Fallen MC and when you made a deal with a man who is worse than the devil, there was no going back....</p> <p><i>This is Zeus Garro's story from Lessons In Corruption. A stand-alone in The Fallen Men Series.</i></p>"; 
